import * as React from 'react';
import { StyleSheet, ImageBackground, Button, View, Text } from 'react-native';
import NewBooksScreen from "./NewBooksScreen";

const image = { uri: "https://i.pinimg.com/originals/c1/97/ba/c197ba63b1ff4c94c19243ede3038795.jpg" };

export default function HomeScreen({navigation}) {
    return (
        <View>
            <Text> Welcome to book list!</Text>
            <Button title="Go to Details"
                    onPress={() => navigation.navigate('NewBooksScreen')}
            />
            <View style={styles.imageWrapper}>
                <Text>TEST???</Text>
                <ImageBackground style={styles.theImage} source={image}>
                    <Text>Hey</Text>
                </ImageBackground>
            </View>
        </View>

    );
}

const styles = StyleSheet.create({
    imageWrapper: {
        height: 900,
        width: '50%',
        overflow : "visible"
    },
    theImage: {
        height:200,
        resizeMode: "contain",
    }
})
